import React from "react";
import {
  Route,
  Routes,
} from "react-router-dom";
import Home from "./Home";
import VocabularyPage from "./VocabularyPage";

function RouterContent({LessonList , removeLesson , addLesson,searchLesson }) {
    return ( 
        <Routes >
            <Route exact path="/home" element={<Home LessonList = {LessonList} removeLesson = {removeLesson} addLesson = {addLesson} />} />
            <Route path="/home/:lessonId/vocabulary" element={<VocabularyPage />} />
        </Routes>
    );
}

export default RouterContent;

